import styled, { css } from 'styled-components';

function BaseButton () {
  return (`
  border 0;
  padding: 0;
  font-family: inherit;
  font-weight: normal;
  background-color: unset;
  box-sizing: border-box;
  cursor: pointer;
  outline: none;
  border-radius: 4px;
  font-weight: bold;
  `
  );
}

export default BaseButton;
